import React, { Component } from 'react';
import PropTypes from 'prop-types';


export class TodoItem extends Component {
    render() {
        return (
            <div>
                <p>{this.props.smarts.title}</p>
            </div>
        )
    }
}

// PropTypes
TodoItem.propTypes = {
    smarts: PropTypes.object.isRequired
}

export default TodoItem
